import './Responses.css'
import Choice from './Choice'

import {Form} from 'semantic-ui-react'

const Responses = props => {
  return (
    <div className="responses">
      {props.responses.map(r => {
        let checked = false
        console.log(props.selectedResponse)
        if (props.selectedResponse() === r) {
          checked = true
          console.log('TRUE')
        }
        return (
            <Choice
              propValue={r}
              index={props.index}
              checked={checked}
            />
        )
      })}
    </div>
  )
}
export default Responses
